import React, { useEffect } from 'react';

const Userdata = () => {
  const x = 'https://jsonplaceholder.typicode.com/users';
  const User = async (x) => {
    try {
      await fetch(x).then((res) => {
        res.json();
      });
    } catch (e) {
      console.error(e);
    }
  };

  fetch(x)
    .then((res) => {
      return res.json();
    })
    .then((data) => {
      return console.log(data);
    });

  useEffect(() => {
    User(x);
  });
  return <div>Userdata</div>;
};

export default Userdata;
